import React from "react";
import { SHOP_ITEMS } from "src/utils/constants";

class ShopPage extends React.Component {
  constructor(props) {
    super(props);

    this.state = {
      itemCollection: SHOP_ITEMS,
    };
  }

  render() {
    const { itemCollection } = this.state;

    return (
      <div>
        {itemCollection.map((item) => (
          <div>
            <li>{item.title}</li>
          </div>
        ))}
      </div>
    );
  }

  // return <div>{itemCollection.map((item) => <div>{item.title}</div>)}
}
export default ShopPage;
